def sum_in_range(lst):
    return sum(num for num in lst if 4 <= num <= 9)
```

Explanation: The function `sum_in_range` takes a single argument `lst`, which is a list of integers. It uses a list comprehension to filter the integers in the list that are between 4 and 9 (inclusive), and then computes the sum of those filtered integers using the `sum` function. If the filtered list is empty, indicating that there are no integers between 4 and 9, the function returns 0.
